import React from 'react';
import { Layout as AntLayout, Menu } from 'antd'; // Importă Menu

const { Header, Content, Footer } = AntLayout;
const menuItems = [
    { key: 'home', title: 'Home', link: '/' },
    { key: 'about', title: 'About', link: '/about' },
    { key: 'contact', title: 'Contact', link: '/contact' },
    // Alte elemente...
];
const Layout = () => {
    return (
        <AntLayout>
            <Header>
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
                    <Menu.Item key="1">Acasă</Menu.Item>
                    <Menu.Item key="2">Despre</Menu.Item>
                    <Menu.Item key="3">Contact</Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                <div className="site-layout-content">
                    Conectează-te și împărtășește-ți ideile în comunitatea noastră online.
                </div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>
                Contact: contact@exemplu.com | Telefon: +1234567890
            </Footer>
        </AntLayout>
    );
};

export default Layout;
